import styled from 'styled-components'

const Container = styled.div`
    display: flex;
    flex-direction: column;
    height: 100%;
    flex: 3;
    background: #f6f7f8;
`
const ChatHeader = styled.div `
    display: flex;
`

const ChatComponent = () => {
    return(
        <Container>
            <ChatHeader />
        </Container>
    )
}

export default ChatComponent;
